import { Image } from 'react-bootstrap';

const Contacts = () =>
{
    return (
        <div>
            <div></div>
            <Image src="/home.svg" alt="home icon" />
            <Image src="/phone.svg" alt="phone icon" />
            <Image src="/email.svg" alt="email icon" />
        </div>
    )
}

export default Contacts
